pragma solidity ^0.5.0;

contract DVideo {
  uint public videoCount = 0;
  string public name = "DVideo";
  mapping(uint => Video) public videos;
  uint lastUpdated;
  

  struct Video {
    uint id;
    string hash;
    string title;
    address author;
    uint lastUpdated;
  }

  event VideoUploaded(
    uint id,
    string hash,
    string title,
    address author,
    uint lastUpdated
  );

  constructor() public {
  }
  function updateTimestamp() public {
  lastUpdated = now;
}

  function uploadVideo(string memory _videoHash, string memory _title) public {
    // Make sure the video hash exists
    require(bytes(_videoHash).length > 0);
    // Make sure video title exists
    require(bytes(_title).length > 0);
    // Make sure uploader address exists
    require(msg.sender!=address(0));
    
    // Increment video id
    videoCount ++;
    updateTimestamp();
    // Add video to the contract
    videos[videoCount] = Video(videoCount, _videoHash, _title, msg.sender, lastUpdated);
    // Trigger an event
    emit VideoUploaded(videoCount, _videoHash, _title, msg.sender, lastUpdated);
  }
}
